script: |
  super -f text -I q9164.spq | sort > q9164.out

inputs:
  - name: q9164.spq
    data: |
      SELECT ALL + 99 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT - 12 NOT BETWEEN ( + col0 * + 54 * - col0 * col2 - 18 - + col1 + + 65 + 40 + + col1 / + col0 + + 29 * + + col2 * col1 / 82 * - 67 * - col0 ) AND NULL;
  - name: tab2

outputs:
  - name: q9164.out
    data: |
